using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// A UIScreenEdgePanGestureRecognizer looks for panning (dragging) gestures that start near an edge of the screen. The system uses screen edge gestures in some cases to initiate view controller transitions. You can use this class to replicate the same gesture behavior for your own actions.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIScreenEdgePanGestureRecognizer_class/index.html#//apple_ref/occ/cl/UIScreenEdgePanGestureRecognizer"/>    [iOSVersion(7)]    public class UIScreenEdgePanGestureRecognizer : UIPanGestureRecognizer//, AnyObject, NSObjectProtocol    {        public UIScreenEdgePanGestureRecognizer() { }        /// <summary>        /// The acceptable starting edges for the gesture.        /// </summary>        [iOSVersion(7)]        [Export("edges")]        public UIRectEdge Edges { get; set; }    }}